import React from "react";
import Base from "./Base";

const Cart = () => {

    const loadAllProducts = () => {
        return (
            <div>
                <h1>Products</h1>
            </div>
        )
    }

    const loadCheckout = () => {
        return (
            <div>
                <h1>Checkout</h1>
            </div>
        )
    }
    return(
        <Base title="This is Cart page">
            <div className="row text-center">
                <div className="col-6">
                    {loadAllProducts()}
                </div>
                <div className="col-6">
                    {loadCheckout()}
                </div>

            </div>
        </Base>
    )
}
export default Cart;
